import { mixins } from "@v2-lib/vue.spa.plugin";
import vda from "@/api/pipe.vda.js";
import { setInterval, clearInterval } from "timers";
export default {
  mixins: [mixins],
  components: {// tree,
    // node
  },
  data: function data() {
    return {
      src: ""
    };
  },
  props: {
    params: String //父组件传过来的参数

  },
  methods: {},
  mounted: function mounted() {
    var _this = this;

    var context = this;
    var frame = this.$refs.vdaCtn;
    var loading = this.$loading({
      target: this.$el.parentElement,
      customClass: "vda-shelter"
    });
    vda.ready().then(function (res) {
      if (res) {
        window.localStorage.setItem("token", res);
        console.log(res);
        _this.src = "./v1/ds/dvms//index.html#/dataBoard/echarts-demo/AWEB测试";

        frame.onload = function () {
          var frameContext = this;
          var waitForPageHandler = setInterval(function () {
            var $ = frameContext.contentWindow.$;
            var $el = frameContext.contentDocument;

            if ($ && $(".container-panel.active", $el).length) {
              var $header = $('.vda-header-wraper', $el);
              $header.hide();
              var $page = $("#app", $el);
              $page.css({
                position: "fixed",
                top: 0,
                right: 0,
                bottom: 0,
                left: 0,
                overflow: "auto",
                height: '100%',
                width: '100%',
                zIndex: 1
              });
              loading.close();
              clearInterval(waitForPageHandler);
            }
          }, 100);
        };
      }
    }).catch(function (e) {
      _this.$notify.error({
        title: '加载编辑器失败',
        message: e
      });
    });
    window.ts = this;
  }
};
